import * as React from "react";


import AppBar from "@mui/material/AppBar";
import Toolbar from "@mui/material/Toolbar";
import Divider from "@mui/material/Divider";
import Typography from "@mui/material/Typography";
import IconButton from "@mui/material/IconButton";
import Box from "@mui/material/Box";
import Button from '@mui/material/Button';
import TextField from '@mui/material/TextField';
import Dialog from '@mui/material/Dialog';
import DialogActions from '@mui/material/DialogActions';
import DialogContent from '@mui/material/DialogContent';
import DialogContentText from '@mui/material/DialogContentText';
import DialogTitle from '@mui/material/DialogTitle';

import LockIcon from "@mui/icons-material/Lock";
import HistoryIcon from "@mui/icons-material/History";
import sso from "../sso.png";
import LogoutIcon from '@mui/icons-material/Logout';
import Avatar from '@mui/material/Avatar';
import PersonIcon from '@mui/icons-material/Person';

export default function Header() {
  const [open, setOpen] = React.useState(false);

  const handleClickOpen = () => {
    setOpen(true);
  };

  const handleClose = () => {
    setOpen(false);
  };
  const [date, setDate] = React.useState(new Date());
  React.useEffect(() => {
    const timer = setInterval(() => {
      setDate(new Date());
    }, 1000*30);
    return () => {
      clearInterval(timer);
    };
  }, []);
  const day = date.toLocaleDateString("th-TH", {
    year: "numeric",
    month: "long",
    day: "numeric",
  });
  const time = date.toLocaleString("th-TH", {
    hour: "numeric",
    minute: "numeric",
  });
  //console.log(day);

  return (
    <AppBar potion="static" sx={{ zIndex: (theme) => theme.zIndex.drawer + 1 }}>
      <Toolbar variant='dense'>
        <Typography variant="body2">{day}</Typography>

        <Divider
          orientation="vertical"
          flexItem="true"
          variant="middle"
          light
          sx={{ margin: 2 }}
        />

        <Typography sx={{ flexGrow: 1 }} variant="body2"> {time} น.</Typography>
        <IconButton color="inherit" >
          <LockIcon />
          <Typography variant="body2">เปลี่ยนรหัสผ่าน</Typography>
        </IconButton>
        <Dialog open={open} onClose={handleClose}>
        <DialogTitle>Subscribe</DialogTitle>
        <DialogContent>
          <DialogContentText>
            To subscribe to this website, please enter your email address here. We
            will send updates occasionally.
          </DialogContentText>
          <TextField
            autoFocus
            margin="dense"
            id="name"
            label="Email Address"
            type="email"
            fullWidth
            variant="standard"
          />
        </DialogContent>
        <DialogActions>
          <Button onClick={handleClose}>Cancel</Button>
          <Button onClick={handleClose}>Subscribe</Button>
        </DialogActions>
      </Dialog>
        <Divider
          orientation="vertical"
          flexItem="true"
          variant="middle"
          light
          sx={{ margin: 2 }}
        />
        <IconButton color="inherit">
          <HistoryIcon />
          <Typography variant="body2">ประวัติการใช้งานระบบ</Typography>
        </IconButton>
      </Toolbar>
      <Toolbar variant='dense'
        sx={{
          backgroundColor: "#ffffff",
        }}
      >
        {" "}
        <img src={sso} width="70" height="70" />
        <Box sx={{ flexGrow: 1 }}>
          <Typography color="black">ระบบรับเรื่องร้องเรียน</Typography>
          <Typography color="gray" variant="subtitle2" >
            สำนักงานประกันสังคม
          </Typography>
        </Box>
        <Box sx={{ p: 1,}}>
          <Typography color="black" align="right">เจ้าหน้าที่</Typography>
         <IconButton edge='end'>
        <LogoutIcon/><Typography variant="subtitle2" >
          ออกจากระบบ
        </Typography>
         </IconButton>
        </Box>
        <Avatar sx={{ width: 56, height: 56 }}>
          <PersonIcon/>
        </Avatar>
      </Toolbar>
    </AppBar>
  );
}
